text-decoration : line-through;\r\n}\r\n.startpageProductTitle {\r\n        font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\r\n        font-size: 12px;\r\n        color: #242424;\r\n        font-weight: bold;\r\n}\r\n.startpageProductText {\r\n        font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\r\n        font-size: 10px;\r\n        color: #AB0101;\r\n        font-weight: normal;\r\n}\r\n.startpageBoxContent {\r\n   font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\r\n font-size: 10px;\r\n    color: #000000;\r\n font-weight: normal;\r\n    border : 3px #CECDCD;\r\n   border-style : none solid solid solid;\r\n  padding-left : 5px;\r\n padding-top : 5px;\r\n  padding-bottom : 5px;\r\n   padding-right : 5px;\r\n}\r\n.startpageBoxHead {\r\n        font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\r\n        font-size: 10px;\r\n        color: #000000;\r\n        font-weight: bold;\r\n        background-color: #CECDCD;\r\n}\r\n.newestProductHead {\r\n        font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\r\n        font-size: 10px;\r\n        color: #8D0101;\r\n        font-weight: bold;\r\n}\r\n.newestProduct {\r\n        font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\r\n        font-size: 10px;\r\n        color: #000000;\r\n        font-weight: normal;\r\n}\r\n}\r\n--></style>\r\n</head>\r\n<body marginwidth="0" marginheight="0" leftmargin="0" topmargin="0">\r\n<table width="780" height="100%" cellspacing="0" cellpadding="0" border="0"><!-- Kopf Start --><tbody><tr><td class="pagehead">\r\n<table width="100%" cellspacing="0" cellpadding="0" border="0"><tbody><tr><td width="152" align="right" class="pagehead"> <a class="pageheadlink" href="[{$oViewConf->getBaseDir()}]"><img border="0" alt="" src="[{$oViewConf->getImageUrl()}]/logo.png"></a> </td></tr></tbody></table></td></tr><tr><td height="15"> <br>\r\n</td></tr><!-- Kopf Ende --> <!-- Content Start --><tr><td valign="top">\r\n<table width="100%" height="100%" cellspacing="0" cellpadding="0" border="0"><tbody><tr><td class="defaultcontent">\r\nHallo [{ $myuser->oxuser__oxsal->value }] [{ $myuser->oxuser__oxfname->value }] [{ $myuser->oxuser__oxlname->value }],<br>\r\n<br>\r\nwie Sie sehen können funktioniert unser Newsletter Modul richtig gut.<br>\r\n<br>\r\nNicht nur, das wir hier Ihre Adresse ausgeben können :<br>\r\n [{ $myuser->oxuser__oxaddinfo->value }]<br>\r\n[{ $myuser->oxuser__oxstreet->value }]<br>\r\n[{ $myuser->oxuser__oxzip->value }] [{ $myuser->oxuser__oxcity->value }]<br>\r\n[{ $myuser->oxuser__oxcountry->value }]<br>\r\nTelefon: [{ $myuser->oxuser__oxfon->value }]<br>\r\n<br>\r\nsondern wir können noch viel mehr !<br>\r\n<br>\r\nSie wollen diesen Newsletter nicht mehr erhalten ? Kein Problem - klicken Sie einfach <a class="defaultcontent" href="[{$oViewConf->getBaseDir()}]index.php?cl=newsletter&amp;fnc=removeme&amp;uid=[{$myuser->oxuser__oxid->value}]">hier</a>.\r\n<br>\r\n<br>\r\n [{if isset($simarticle0) }]\r\n     Ein Ähnlicher Artikel zu Ihrer letzten Bestellung :<br>\r\n\r\n<table cellspacing="0" cellpadding="0" border="0"><tbody><tr><td> <a href="[{$simarticle0->oxdetaillink}]" class="startpageProduct"><img vspace="0" hspace="0" border="0" alt="[{ $simarticle0->oxarticles__oxtitle->value }]" src="[{$oViewConf->getPictureDir()}][{$simarticle0->oxarticles__oxpic1->value }]"></a> </td><td width="10" valign="top" class="startpageFirstProductTitle">*</td><td width="320" valign="top" class="startpageFirstProductTitle"> [{ $simarticle0->oxarticles__oxtitle->value }]<br>\r\n <br>\r\n <span class="startpageFirstProductText">[{ $simarticle0->oxarticles__oxshortdesc->value }]</span><br>\r\n <br>\r\n <span class="startpageProductText"><strong>Statt <span class="startpageFirstProductOldPrice">[{ $simarticle0->ftprice}]</span> jetzt nur </strong></span><span class="startpageFirstProductPrice">[{ $simarticle0->fprice }] [{ $mycurrency->sign}]</span><br>\r\n <br>\r\n <a href="[{$simarticle0->oxdetaillink}]" class="startpageProductText"><strong>mehr Infos</strong></a><br>\r\n </td></tr></tbody></table> [{/if}] <br>\r\n<br>\r\n [{if isset($articlelist) }]\r\n     Ausgesuchte Artikel aus unserem Shop extra für diesen Newsletter : <br>\r\n\r\n<table cellspacing="0" cellpadding="0" border="0"><tbody><tr><td height="1" bgcolor="#cecdcd"><br>\r\n</td><td height="1" bgcolor="#cecdcd"><br>\r\n</td></tr><tr><td height="7"><br>\r\n</td><td><br>\r\n</td></tr>[{assign var="iPos" value=1}]\r\n       [{foreach from=$articlelist item=product}]\r\n     \r\n        [{if $iPos == 1}] <tr><td valign="top">\r\n<table cellspacing="0" cellpadding="0" border="0"><tbody><tr><td width="220" height="100" align="left" class="startpageProduct"> <a href="[{$product->oxdetaillink}]" class="startpageProduct"><img vspace="0" hspace="0" border="0" alt="[{ $product->oxarticles__oxtitle->value }]" src="[{$oViewConf->getPictureDir()}][{$product->oxarticles__oxthumb->value }]"></a> </td></tr><tr><td align="left" class="startpageProductTitle"> [{ $product->oxarticles__oxtitle->value }] </td></tr><tr><td height="20" align="left" class="startpageProductText"> <strong>Jetzt nur [{ $product->fprice }] [{ $mycurrency->sign}]</strong> </td></tr><tr><td height="20" align="left" class="startpageProductText"> <a href="[{$product->oxdetaillink}]" class="startpageProductText">mehr Infos</a><br>\r\n </td></tr></tbody></table> </td>[{assign var="iPos" value=2}]\r\n       [{elseif $iPos==2}] <td valign="top">\r\n<table cellspacing="0" cellpadding="0" border="0"><tbody><tr><td width="220" height="100" align="left" class="startpageProduct"> <a href="[{$product->oxdetaillink}]" class="startpageProduct"><img vspace="0" hspace="0" border="0" alt="[{ $product->oxarticles__oxtitle->value }]" src="[{$oViewConf->getPictureDir()}][{$product->oxarticles__oxthumb->value }]"></a> </td></tr><tr><td align="left" class="startpageProductTitle"> [{ $product->oxarticles__oxtitle->value }] </td></tr><tr><td height="20" align="left" class="startpageProductText"> <strong>Jetzt nur [{ $product->fprice }] [{ $mycurrency->sign}]</strong> </td></tr><tr><td height="20" align="left" class="startpageProductText"> <a href="[{$product->oxdetaillink}]" class="startpageProductText">mehr Infos</a><br>\r\n </td></tr></tbody></table> </td></tr><tr><td height="7"><br>\r\n</td><td><br>\r\n</td></tr><tr><td height="1" bgcolor="#cecdcd"><br>\r\n</td><td height="1" bgcolor="#cecdcd"><br>\r\n</td></tr><tr><td height="7"><br>\r\n</td><td><br>\r\n</td></tr><!-- ende zeile --> [{assign var="iPos" value=1}]\r\n       [{/if}]\r\n     [{/foreach}] <!-- fehlende ausgleichen --> [{if $iPos == 1}] <tr><td><br>\r\n</td></tr>[{/if}] </tbody></table> [{/if}] <br>\r\n </td><td width="165" align="right" class="defaultcontent"> [{ if $simarticle1 }]\r\n     Auch das hier ist ein Ähnlicher Artikel zu Ihrer letzten Bestellung :<br>\r\n\r\n<table width="100%" cellspacing="0" cellpadding="0" border="0"><tbody><tr><td width="100%" height="15" align="center" class="aktionhead">Top Angebot der Woche</td></tr><tr><td class="aktionmain">\r\n<table cellspacing="0" cellpadding="0" border="0"><tbody><tr><td class="aktion"><a href="[{$simarticle1->oxdetaillink}]" class="aktion"><img vspace="0" hspace="0" border="0" alt="[{ $simarticle1->oxarticles__oxtitle->value }]" src="[{$oViewConf->getPictureDir()}][{$simarticle1->oxarticles__oxthumb->value }]"></a></td></tr><tr><td height="15" class="aktion">[{ $simarticle1->oxarticles__oxtitle->value }]</td><td class="aktion"><br>\r\n</td></tr><tr><td height="15" class="aktionhighlight"><strong>Jetzt nur [{ $simarticle1->fprice }] [{ $mycurrency->sign}] !!</strong></td></tr><tr><td height="25" class="aktion">\r\n<table cellspacing="0" cellpadding="0" border="0"><tbody><tr><td width="120" class="aktion"><a href="[{$simarticle1->oxdetaillink}]" class="aktion">mehr Infos</a></td></tr></tbody></table> </td></tr></tbody></table> </td></tr></tbody></table> [{ /if }] <br>\r\n <br>\r\n [{ if $simarticle2 }]\r\n       Und zuletzt nochmal ein Ähnlicher Artikel zu Ihrer letzten Bestellung :<br>\r\n\r\n<table width="100%" cellspacing="0" cellpadding="0" border="0"><tbody><tr><td width="165" height="15" align="center" class="aktionhead">Schnäppchen !</td></tr><tr><td valign="top" height="145" class="aktionmain"> Jetzt gibt es unseren Bestseller <a class="aktionhighlight" href="[{$simarticle2->oxdetaillink}]">[{ $simarticle2->oxarticles__oxtitle->value }]</a> in der günstigen Sonderausgabe exklusiv bei OXID !<br>\r\n Gleich <a class="aktionhighlight" href="[{$simarticle2->tobasketlink}]&am=1">bestellen</a> !<br>\r\n </td></tr></tbody></table> [{/if}] </td></tr></tbody></table> </td></tr><tr><td align="right" class="pagebottom">\r\n© 2005 OXID </td></tr></tbody></table>\r\n</body>\r\n</html>', 'OXID eSales Newsletter\r\n\r\nHallo, [{ $myuser->oxuser__oxsal->value }] [{ $myuser->oxuser__oxfname->value }] [{ $myuser->oxuser__oxlname->value }],\r\n\r\nwie Sie sehen können, funktioniert unser Newsletter-Modul richtig gut.\r\n\r\nNicht nur, dass wir hier Ihre Adresse ausgeben können:\r\n\r\n[{ $myuser->oxuser__oxaddinfo->value }]\r\n[{ $myuser->oxuser__oxstreet->value }]\r\n[{ $myuser->oxuser__oxzip->value }] [{ $myuser->oxuser__oxcity->value }]\r\n[{ $myuser->oxuser__oxcountry->value }]\r\nTelefon: [{ $myuser->oxuser__oxfon->value }]\r\n\r\nsondern wir können noch viel mehr!\r\n\r\nSie wollen diesen Newsletter nicht mehr erhalten? Kein Problem - klicken Sie einfach hier:\r\n[{$oViewConf->getBaseDir()}]index.php?cl=newsletter&fnc=removeme&uid=[{ $myuser->oxuser__oxid->value}]\r\n\r\n[{if isset($simarticle0) }]\r\n   Ein Ähnlicher Artikel zu Ihrer letzten Bestellung ist:\r\n \r\n    [{ $simarticle0->oxarticles__oxtitle->value }] \r\n Statt [{ $simarticle0->ftprice}] jetzt nur [{ $simarticle0->fprice }] [{ $mycurrency->name}]\r\n[{/if}]\r\n\r\n[{if isset($articlelist) }]\r\n  Ausgesuchte Artikel aus unserem Shop extra für diesen Newsletter: \r\n     [{foreach from=$articlelist item=product}]  \r\n        [{ $product->oxarticles__oxtitle->value }]   Jetzt nur [{ $product->fprice }] [{ $mycurrency->name}]\r\n    [{/foreach}] \r\n[{/if}]           \r\n     \r\n');
