INSERT INTO `oxartextends` VALUES('1849', '<div>Für 6 Flaschen. </div>\r\n<div>&nbsp;</div>\r\n<div>Höhe: 52 cm <br>\r\nMaterial: Chrom</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '', '', '', 'flaschen höhe cm__ material chrombezugshinweis', '', '', '');
INSERT INTO `oxartextends` VALUES('1126', '<div>Der Zauber der "grünen Fee" (das heisst Absinth übersetzt) ist mal wieder legal! Keiner weiss so genau, was sich hinter den wilden Geschichten verbirgt. Schon viele Intellektuelle vor dir, von Hemingway bis Oscar Wild, haben sich seit dem 18. Jahrhundert von dem teuflischen Getränk um den Verstand bringen lassen. Alles für das sehr spezielle Trink-Ritual und noch einige Rezepte dazu, stecken in unserem Barset ABSINTH. All inclusive sozusagen. </div>\r\n<div>&nbsp;</div>\r\n<div><strong>Ab 18 Jahren!</strong><br>\r\n<br>\r\nInhalt:<br>\r\n2 Absinth Gläser<br>\r\n1 Absinthlöffel Devil<br>\r\n2 Fläschchen Absinth (je 4 cl)</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '', '', '', 'zauber grünen fee_ heisst absinth übersetzt mal_ wieder legal', '', '', '');
INSERT INTO `oxartextends` VALUES('2080', '<p>Die kleine Zange zeichnet sich durch funktionales Design aus. Dadurch entfernt sie ideal nicht nur den Verschlussdraht von Flaschen, sondern ist bestens dazu geeignet festsitzende Champagner-und Sektkorke sowie Schraubverschlüsse einfach zu öffnen. </p>\r\n<p>Schnelle Hilfe bietet die Barzange ebenfalls als Kapselhebel und auch als Deckelheber für Schraubgläser: Deckel anheben, Luft hineinlassen und ohne Kraftaufwand das Glas aufschrauben.</p>\r\n<div>Design: Numsen<br>\r\n<div>Edler Zinkdruckguß + satiniert.<br>\r\nMasse: 16,9 cm x 4,3 cm x 2,3 cm.<br>\r\nGewicht: 268g</div></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<p>Die kleine Zange zeichnet sich durch funktionales Design aus. Dadurch entfernt sie ideal nicht nur den Verschlussdraht von Flaschen, sondern ist bestens dazu geeignet festsitzende Champagner-und Sektkorke sowie Schraubverschlüsse einfach zu öffnen. </p>\r\n<p>Schnelle Hilfe bietet die Barzange ebenfalls als Kapselhebel und auch als Deckelheber für Schraubgläser: Deckel anheben, Luft hineinlassen und ohne Kraftaufwand das Glas aufschrauben.</p>\r\n<div>Design: Numsen<br>\r\n<div>Edler Zinkdruckguß + satiniert.<br>\r\nMasse: 16,9 cm x 4,3 cm x 2,3 cm.<br>\r\nGewicht: 268g</div></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '', '', 'kleine zange zeichnet durch funktionales design dadurch entfernt', '', '', '');
INSERT INTO `oxartextends` VALUES('1651', '<div>&nbsp;</div>\r\n<div>Da kann das Bier aus dem Getränkemarkt in Zukunft\r\nnicht mehr mithalten. Dein edles Gebräu Marke ''Do it yourself'' ist ein\r\nriesen Partyspaß und schmeckt sogar richtig gut! Das Set PROSIT\r\nenthält alles was Du zur Herstellung von ca. 25 Liter naturtrübem Bier\r\nbrauchst.</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '', '', '', 'bier getränkemarkt zukunftnicht mehr mithalten', '', '', '');
INSERT INTO `oxartextends` VALUES('1127', '<div>Schön geglitzert hat Eis ja schon immer, aber dieses hier bietet nochmals eine andere Dimension! Einige Stunden vorher ins Gefrierfach gepackt, fangen die Eiswürfel FLASH beim Kontakt mit dem Drink an wie wild zu blinken. Ausgeschaltet werden sie, indem du sie einfach abtrocknest. Ca. 100 Stunden lang kannst du das Schauspiel bewundern. Das sind, je nach Trinkgfestigkeit deiner Gäste, eine ganze Menge Partys.<br>\r\n<br>\r\nInhalt: 2 Stück im Set</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '', '', '', 'schön geglitzert eis_ schon immer hier bietet nochmals andere', '', '', '');
