INSERT INTO `oxartextends` VALUES('1431', '<div>Nicht nur für liebliche Drinks! Du packst sie so wie sie sind ins Gefrierfach und dann ab damit ins Glas. Kein lästiges eingiessen von Wasser in irgendwelche Formen. Darüberhinaus gehören verwässerte Drinks damit der Vergangenheit an!</div>\r\n<div>Menge: 18 Stück</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '', '', '', 'liebliche drinks packst gefrierfach', '', '', '');
INSERT INTO `oxartextends` VALUES('1142', '<div>Das richtige Werkzeug für den Feierabend. Also die Jungs draussen auf dem Bau nehmen ja normalerweise eine zweite Flasche um die erste zu köpfen. Aber das wollen wir euch nicht wirklich antun. </div>\r\n<div>Dann sind die Heimwerker also einfach mal einen Schritt voraus.</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '', '', '', 'richtige werkzeug feierabend jungs draussen bau_ nehmen', '', '', '');
